package scalecodec_test

import (
	"bytes"
	"github.com/freehere107/scalecodec"
	"github.com/freehere107/scalecodec/utiles"
	"testing"
)

const Metadata = ""

func TestMetadataDecoderInit(t *testing.T) {
	m := scalecodec.MetadataDecoder{}
	m.Init(utiles.HexToBytes(Metadata))
	if bytes.Equal(m.Data.Data, utiles.HexToBytes(Metadata)) == false {
		t.Errorf("Test MetadataDecoder Init data fail")
	}
	if m.Data.Offset != 0 {
		t.Errorf("MetadataDecoder Init offset not equal 0")
	}
}

func TestMetadataDecoderProcess(t *testing.T) {
	m := scalecodec.MetadataDecoder{}
	m.Init(utiles.HexToBytes(Metadata))
	if m.Process() != nil {
		t.Errorf("Test MetadataDecoder Process fail")
	}
	if m.Version != "MetadataV6Decoder" {
		t.Errorf("Metadata version should equal 6")
	}
}
